export class ItemTerm implements Entity
{

    constructor(public title?: string,
                public fieldId?: string,
                public isMultiValue?: boolean,
                public acceptableValues?: string,
                public isEditable?: boolean,
                public valueTypeName?: string,
                public value?: ItemValue,
                public listOfChoices?: ItemValue[],
                public precision?: number,
                public fromValue?: ItemValue,
                public toValue?: ItemValue,
                public requiredType?: number,
                public enableParticipantComments?: boolean,
                public rollup?: boolean,
                public historicValueProperty?: number,
                public reserveValueProperty?: number,
                public participantVisibility?: number,
                public percentageDifferenceToLeadingBid?: number,
                public references?: Attachment[],
                public isFormula?: boolean,
                public formula?: string,
                public formulaDefinition?: string,
                public formulaCurrentAlias?: string,
                public formulaForEditing?: string,
                public historyValue?: ItemValue,
                public reserveValue?: ItemValue,
                public sourceType?: number,
                public defaultValues?: ItemValue[],
                public isDeleteable?: boolean,
                public columnDisplay?: boolean
    )
    {
    }

    identity(): string
    {
        return this.fieldId;
    }

    getTypes(): any
    {
        return {
            title: String,
            fieldId: String,
            isMultiValue: Boolean,
            acceptableValues: String,
            isEditable: Boolean,
            valueTypeName: String,
            value: ItemValue,
            listOfChoices: ItemValue,
            precision: Number,
            fromValue: ItemValue,
            toValue: ItemValue,
            requiredType: Number,
            enableParticipantComments: Boolean,
            rollup: Boolean,
            historicValueProperty: Number,
            reserveValueProperty: Number,
            participantVisibility: Number,
            percentageDifferenceToLeadingBid: Number,
            references: Attachment,
            isFormula: Boolean,
            formula: String,
            formulaDefinition: String,
            formulaCurrentAlias: String,
            formulaForEditing: String,
            historyValue: ItemValue,
            reserveValue: ItemValue,
            sourceType: Number,
            defaultValues: ItemValue,
            isDeleteable: Boolean,
            columnDisplay: Boolean
        };
    }

    $proto(): ItemTerm
    {
        return new ItemTerm('Price',
            'PRICE',
            false,
            null,
            true,
            'Money',
            new ItemValue(null, null, new Money(1)),
            [],
            2, new ItemValue(null, null, new Money(1)),
            new ItemValue(null, null, new Money(1000)), 1,
            false, false,
            1, 1, 1, 1, [new Attachment()],
            false, '', '', '', '',
            new ItemValue(null, null, new Money(1)),
            new ItemValue(null, null, new Money(1)),
            1,
            [],
            false,
            false);
    }

    className(): string
    {
        return 'ItemTerm';
    }

    toString(): string
    {
        return `${this.fieldId}_${this.valueTypeName}_${this.acceptableValues}: ${this.value}`;
    }

    getNewListOfChoices(list: ItemValue[]): ItemValue[]
    {
        let newList: any[] = [];
        list.forEach((iv: ItemValue) =>
        {
            let newIV = (new ItemValue()).clone(iv);
            newList.push(newIV);
        });
        return newList;
    }

    clone(datas: {
        title?: string,
        fieldId?: string,
        isMultiValue?: boolean,
        acceptableValues?: string,
        isEditable?: boolean,
        valueTypeName?: string,
        value?: ItemValue,
        listOfChoices?: ItemValue[],
        precision?: number,
        fromValue?: ItemValue,
        toValue?: ItemValue,
        requiredType?: number,
        enableParticipantComments?: boolean,
        rollup?: boolean,
        historicValueProperty?: number,
        reserveValueProperty?: number,
        participantVisibility?: number,
        percentageDifferenceToLeadingBid?: number,
        references?: Attachment[],
        isFormula?: boolean,
        formula?: string,
        formulaDefinition?: string,
        formulaCurrentAlias?: string,
        formulaForEditing?: string,
        historyValue?: ItemValue,
        reserveValue?: ItemValue,
        sourceType?: number,
        defaultValues?: ItemValue[],
        isDeleteable?: boolean,
        columnDisplay?: boolean

    } = {}): ItemTerm
    {

        return new ItemTerm(
            datas.title,
            datas.fieldId,
            datas.isMultiValue,
            datas.acceptableValues,
            datas.isEditable,
            datas.valueTypeName,
            isPresent(datas.value) ? (new ItemValue).clone(datas.value) : new ItemValue(),
            isPresent(datas.listOfChoices) ?
                this.getNewListOfChoices(datas.listOfChoices) : [],
            datas.precision,
            isPresent(datas.fromValue) ? (new ItemValue).clone(datas.fromValue)
                : new ItemValue(),
            isPresent(datas.toValue) ? (new ItemValue).clone(datas.toValue)
                : new ItemValue(),
            datas.requiredType,
            datas.enableParticipantComments,
            datas.rollup,
            datas.historicValueProperty,
            datas.reserveValueProperty,
            datas.participantVisibility,
            datas.percentageDifferenceToLeadingBid,
            datas.references,
            datas.isFormula,
            datas.formula,
            datas.formulaDefinition,
            datas.formulaCurrentAlias,
            datas.formulaForEditing,
            isPresent(datas.historyValue) ? (new ItemValue).clone(datas.historyValue)
                : new ItemValue(),
            isPresent(datas.reserveValue) ? (new ItemValue).clone(datas.reserveValue)
                : new ItemValue(),
            datas.sourceType,
            isPresent(datas.defaultValues) ?
                this.getNewListOfChoices(datas.defaultValues) : [],
            datas.isDeleteable,
            datas.columnDisplay
        );
    }
}

