export class ItemValue implements Value
{
    constructor(public simpleValue?: string,
                public simpleValues?: string[],
                public moneyValue?: Money,
                public moneyDifferenceValue?: MoneyDifference,
                public quantityValue?: Quantity,
                public addressValue?: Address,
                public bigDecimalValue?: number,
                public moneyValues?: Money[],
                public bigDecimalValues?: number[],
                public attachmentValue?: Attachment,
                public dateValue?: Date)
    {
    }

    getTypes(): any
    {
        return {
            simpleValue: String,
            simpleValues: String,
            moneyValue: Money,
            moneyDifferenceValue: MoneyDifference,
            quantityValue: Quantity,
            addressValue: Address,
            bigDecimalValue: Number,
            moneyValues: Money,
            moneyDifferenceValues: MoneyDifference,
            bigDecimalValues: Number,
            attachmentValue: Attachment,
            dateValue: Date
        };
    }

    $proto(): ItemValue
    {
        return new ItemValue('abc',
            ['def'],
            new Money(1),
            new MoneyDifference(new Money(1), 0.1),
            new Quantity(1),
            new Address(),
            1,
            [],
            [],
            new Attachment(),
            new Date());
    }

    className(): string
    {
        return 'ItemValue';
    }

    clone(data: {
        simpleValue?: string,
        simpleValues?: string[],
        moneyValue?: Money,
        moneyDifferenceValue?: MoneyDifference,
        quantityValue?: Quantity,
        addressValue?: Address,
        bigDecimalValue?: number,
        moneyValues?: Money[],
        bigDecimalValues?: number[],
        attachmentValue?: Attachment
        dateValue?: Date

    } = {}): ItemValue
    {

        // NOTE: currently it is shallow copy, do we need deep copy?
        return new ItemValue(
            isPresent(data.simpleValue) ? data.simpleValue : this.simpleValue,
            isPresent(data.simpleValues) ? data.simpleValues : this.simpleValues,
            isPresent(data.moneyValue) ? (new Money(data.moneyValue.amount,
                data.moneyValue.currency)) : this.moneyValue,
            isPresent(data.moneyDifferenceValue) ?
                data.moneyDifferenceValue : this.moneyDifferenceValue,
            isPresent(data.quantityValue) ? (new Quantity()).clone(data.quantityValue)
                : this.quantityValue,
            isPresent(data.addressValue) ? (new Address()).clone(data.addressValue)
                : this.addressValue,
            isPresent(data.bigDecimalValue) ? data.bigDecimalValue : this.bigDecimalValue,
            isPresent(data.moneyValues) ? data.moneyValues : this.moneyValues,
            isPresent(data.bigDecimalValues) ? data.bigDecimalValues : this.bigDecimalValues,
            isPresent(data.attachmentValue) ? data.attachmentValue : this.attachmentValue,
            isPresent(data.dateValue) ? data.dateValue : this.dateValue
        );
    }

    getValue(): any
    {
        if (this.simpleValues) {
            return this.simpleValues;
        } else if (this.moneyValue) {
            return this.moneyValue;
        } else if (this.moneyDifferenceValue) {
            return this.moneyDifferenceValue;
        } else if (this.quantityValue) {
            return this.quantityValue;
        } else if (this.addressValue) {
            return this.addressValue;
        } else if (this.moneyValues) {
            return this.moneyValues;
        } else if (this.bigDecimalValue) {
            return this.bigDecimalValue;
        } else if (this.bigDecimalValues) {
            return this.bigDecimalValues;
        } else if (this.attachmentValue) {
            return this.attachmentValue;
        } else if (this.hasDateValue()) {
            return this.dateValue;
        } else {
            return this.simpleValue;
        }
    }

    toString(): string
    {
        if (this.simpleValues) {
            return this.simpleValues.join(',');
        } else if (this.moneyValue) {
            return this.moneyValue.toString();
        } else if (this.moneyDifferenceValue) {
            return this.moneyDifferenceValue.toString();
        } else if (this.quantityValue) {
            return this.quantityValue.toString();
        } else if (this.addressValue) {
            return this.addressValue.toString();
        }
        if (this.moneyValues) {
            return this.moneyValues.join(',');
        }
        if (this.bigDecimalValues) {
            return this.bigDecimalValues.join(',');
        }
        if (this.bigDecimalValue) {
            return this.bigDecimalValue.toString();
        } else if (this.hasDateValue()) {
            return this.dateValue.toString();
        } else {
            return this.simpleValue;
        }
    }

    getValueString(): string
    {
        let values = [];

        if (this.simpleValues) {
            values.push(this.simpleValues.join(','));
        }

        if (this.moneyValue) {
            values.push(this.moneyValue.toString());
        }

        if (this.moneyDifferenceValue) {
            values.push(this.moneyDifferenceValue.toString());
        }

        if (this.quantityValue) {
            values.push(this.quantityValue.toString());
        }

        if (this.addressValue) {
            values.push(this.addressValue.toString());
        }

        if (this.moneyValues) {
            values.push(this.moneyValues.join(','));
        }

        if (this.bigDecimalValues) {
            values.push(this.bigDecimalValues.join(','));
        }

        if (this.bigDecimalValue) {
            values.push(this.bigDecimalValue.toString());
        }

        if (this.hasDateValue()) {
            values.push(this.dateValue.toString());
        }

        if (this.simpleValue) {
            values.push(this.simpleValue.toString());
        }

        if (this.attachmentValue) {
            values.push(this.attachmentValue.toString());
        }

        return values.join('');
    }

    hasDateValue(): boolean
    {
        if (this.dateValue && this.dateValue.getTime() !== 0) {
            // The default null for date is Jan 01 1970 00:00:00 (i.e. number value = 0).
            return true;
        }
        return false;
    }
}

